import logo from "../img/logo.png"
import "../components/navbar.css"
import {Link} from "react-router-dom";

export default function navbar() {

  return (
    <div className="navbar">
      <img src={logo} alt="" />
      <div></div>
      <div></div>
      <ul>
        {}
      </ul>
    </div>
  )
};
